import React from 'react';
import ReturnUsd from './Usd';
import { gsap, Expo } from 'gsap';


// Return Send USD
export default function SendUsd() {

 React.useEffect(() => {

  window.setTimeout(() => {
   gsap.to('.App-loading-blank', .1, { delay: .1, x: '-1000%', opacity: 0, ease: Expo.easeIn })
  }, 100);

 }, []);

 return (
  <>
   <div className='App-loading-blank'></div>
   <ReturnUsd />
  </>
 );
};
